// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;

import "../core/CardReward.sol";
import "../libraries/NftLibrary.sol";

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

/**
 * @title U Box Sea - ERC721
 *
 * @author Bit Lighthouse. Ace
 * AT: 2021-3-28 | VERSION: v1.0.2
 */

contract Exchange is Member {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.UintSet;

    EnumerableSet.UintSet private _tokens;
    mapping (uint112 => uint256) private _amounts;
    mapping (uint112 => address) private _owners;
    mapping (address => EnumerableSet.UintSet) private _my;

    constructor(address auth_) Member(auth_) { }

    function getExchangeList() public view 
        returns (NftLibrary.DetailStruct[] memory list) {

        uint256 len = _tokens.length();
        list = new NftLibrary.DetailStruct[](len);

        for (uint i = 0; i < len; i++) {
            uint112 tokenId = uint112(_tokens.at(i));
            list[i] = NftLibrary.analysis(tokenId);
            list[i].tokenId = tokenId;
            list[i].amount = _amounts[tokenId];
        }
    }

    function getMyExchangeList(address account_) public view 
        returns (NftLibrary.DetailStruct[] memory list) {

        uint256 len = _my[account_].length();
        list = new NftLibrary.DetailStruct[](len);

        for (uint i = 0; i < len; i++) {
            uint112 tokenId = uint112(_my[account_].at(i));
            list[i] = NftLibrary.analysis(tokenId);
            list[i].tokenId = tokenId;
            list[i].amount = _amounts[tokenId];
        }
    }

    function put(uint112 tokenId_, uint256 amount) public
        CheckStatus("NFTPUT"){

        IERC721 figh = IERC721(authority.members("FIGHTER"));
        require(
            msg.sender == figh.ownerOf(tokenId_),
            "EXCHANGE: Only onwer."
        );

        _tokens.add(tokenId_); _amounts[tokenId_] = amount;
        _my[msg.sender].add(tokenId_); _owners[tokenId_] = msg.sender;
        figh.transferFrom(msg.sender, address(this), tokenId_);
        CardReward cr = CardReward(authority.members("CARDREWARD"));
        cr.doExchange(msg.sender, address(0), tokenId_);
    }

    function pull(uint112 tokenId_) public CheckStatus("NFTPULL"){
        require(
            msg.sender == _owners[tokenId_],
            "EXCHANGE: Only onwer."
        );

        _tokens.remove(tokenId_);
        _my[msg.sender].remove(tokenId_);
        IERC721 figh = IERC721(authority.members("FIGHTER"));
        figh.transferFrom(address(this), msg.sender, tokenId_);
        CardReward cr = CardReward(authority.members("CARDREWARD"));
        cr.doExchange(address(0), msg.sender, tokenId_);

        delete _amounts[tokenId_]; delete _owners[tokenId_];
    }

    function buy(uint112 tokenId_) public CheckStatus("NFTBUY") {
        IERC20 token = IERC20(authority.members("TOKEN"));
        token.transferFrom(msg.sender, _owners[tokenId_], _amounts[tokenId_]);

        _tokens.remove(tokenId_);
        _my[msg.sender].remove(tokenId_);
        IERC721 figh = IERC721(authority.members("FIGHTER"));
        figh.transferFrom(address(this), msg.sender, tokenId_);
        CardReward cr = CardReward(authority.members("CARDREWARD"));
        cr.doExchange(address(this), _owners[tokenId_], tokenId_);

        delete _amounts[tokenId_]; delete _owners[tokenId_];
    }

    function getExchangeListTEST() public 
        returns (NftLibrary.DetailStruct[] memory list) {

        configs["test"] = 1;
        return getExchangeList();
    }

    function getMyExchangeListTEST(address account_) public 
        returns (NftLibrary.DetailStruct[] memory list) {

        configs["test"] = 1;
        return getMyExchangeList(account_);
    }
}

